@Override
public String toString(String field) {
  final StringBuilder sb = new StringBuilder();
  sb.append(getClass().getSimpleName());
  sb.append(':');
  if (!getField().equals(field)) {
    sb.append(" field=");
    sb.append(getField());
    sb.append(':');
  }
  return sb.append(" Lower Left: [")
      .append(minLon)
      .append(',')
      .append(minLat)
      .append(']')
      .append(" Upper Right: [")
      .append(maxLon)
      .append(',')
      .append(maxLat)
      .append("]")
      .append(ToStringUtils.boost(getBoost()))
      .toString();
}

